import './DataGrid.css'


const DataGrid = (props) => {



    return <div className="datagrid-container"><table>
      <tbody>
    <tr>
      <th>Employee ID #1</th>
      <th>Employee ID #2</th>
      <th>Project ID</th>
      <th>Days worked</th>
    </tr>
    {props.employeeStats.map(f => {
      return <tr>
        <td>{props.employeeStats.employeeID}</td>
      </tr>
    })}
    </tbody>
  
  </table></div>;
}

export default DataGrid;
